import React, {Component} from 'react';

class Photo extends Component {
    render(){
      const post = this.props.post;
      return(
        <div>
          <figure>
            <img src = {post.imageLink} alt = {post.description}></img>
            <p>{post.imageLink}</p>
          </figure>
          <figcaption>
            <h4>{post.description}</h4>
          </figcaption>
        </div>
      );
    }
  }

export default Photo;
